import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Createnote from './Createnote';
import Note from './Note';

const Chandkeep=()=>{
    return(<>
    <Header/>
    <Createnote/>
    <Note/>
    <Footer/>
    </>);

};
export default Chandkeep;
